import React from 'react';
import { Grid, Paper, Typography, Box } from '@mui/material';
import { PieChart, Pie, Cell, ResponsiveContainer, Tooltip, Legend } from 'recharts';
import { DataGrid } from '@mui/x-data-grid';

const Devices = () => {
  const deviceStatusData = [
    { name: 'Online', value: 8, color: '#4CAF50' },
    { name: 'Offline', value: 2, color: '#FF5252' },
    { name: 'Warning', value: 1, color: '#FFA726' }
  ];

  const columns = [
    { field: 'name', headerName: 'Device Name', width: 150 },
    { field: 'type', headerName: 'Type', width: 150 },
    { field: 'status', headerName: 'Status', width: 120 },
    { field: 'ip', headerName: 'IP Address', width: 150 },
    { field: 'cpu', headerName: 'CPU Usage', width: 120 },
    { field: 'memory', headerName: 'Memory', width: 120 },
    { field: 'storage', headerName: 'Storage', width: 120 },
    { field: 'bandwidth', headerName: 'Bandwidth', width: 120 },
    { field: 'lastUpdate', headerName: 'Last Update', width: 150 }
  ];

  const rows = [
    { 
      id: 1,
      name: 'Firewall',
      type: 'Network Security',
      status: 'Active',
      ip: '192.168.1.1',
      cpu: '45%',
      memory: '60%',
      storage: '55%',
      bandwidth: '75 Mbps',
      lastUpdate: '2 minutes ago'
    },
    { 
      id: 2,
      name: 'Switch',
      type: 'Network Device',
      status: 'Active',
      ip: '192.168.1.2',
      cpu: '30%',
      memory: '45%',
      storage: '40%',
      bandwidth: '120 Mbps',
      lastUpdate: '1 minute ago'
    },
    { 
      id: 3,
      name: 'Windows Server',
      type: 'Server',
      status: 'Active',
      ip: '192.168.1.3',
      cpu: '65%',
      memory: '75%',
      storage: '80%',
      bandwidth: '90 Mbps',
      lastUpdate: '3 minutes ago'
    },
    { 
      id: 4,
      name: 'Endpoint 1',
      type: 'Workstation',
      status: 'Active',
      ip: '192.168.1.4',
      cpu: '25%',
      memory: '50%',
      storage: '65%',
      bandwidth: '45 Mbps',
      lastUpdate: '5 minutes ago'
    },
    { 
      id: 5,
      name: 'Endpoint 2',
      type: 'Workstation',
      status: 'Active',
      ip: '192.168.1.5',
      cpu: '35%',
      memory: '55%',
      storage: '70%',
      bandwidth: '40 Mbps',
      lastUpdate: '4 minutes ago'
    }
  ];

  return (
    <Box sx={{ width: '100%', p: 2 }}>
      <Typography variant="h4" gutterBottom>
        Device Status
      </Typography>
      
      <Grid container spacing={3}>
        <Grid item xs={12} md={4}>
          <Paper 
            sx={{ 
              p: 3,
              height: '400px',
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              backgroundColor: '#fff'
            }}
          >
            <Box sx={{ width: '100%', height: '100%' }}>
              <ResponsiveContainer>
                <PieChart>
                  <Pie
                    data={deviceStatusData}
                    cx="50%"
                    cy="50%"
                    innerRadius={0}
                    outerRadius={100}
                    dataKey="value"
                    label={({name, percent}) => `${name} ${(percent * 100).toFixed(0)}%`}
                  >
                    {deviceStatusData.map((entry, index) => (
                      <Cell key={`cell-${index}`} fill={entry.color} />
                    ))}
                  </Pie>
                  <Tooltip />
                  <Legend 
                    verticalAlign="bottom" 
                    height={36}
                    formatter={(value) => <span style={{ color: '#666', fontSize: '14px' }}>{value}</span>}
                  />
                </PieChart>
              </ResponsiveContainer>
            </Box>
          </Paper>
        </Grid>

        <Grid item xs={12} md={8}>
          <Paper sx={{ height: 400, width: '100%' }}>
            <DataGrid
              rows={rows}
              columns={columns}
              pageSize={5}
              rowsPerPageOptions={[5]}
              disableSelectionOnClick
              sx={{
                '& .MuiDataGrid-cell': {
                  fontSize: '0.875rem',
                },
                '& .MuiDataGrid-columnHeader': {
                  backgroundColor: '#f5f5f5',
                  fontWeight: 'bold',
                }
              }}
            />
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Devices;
